import logoDesktop from './images/banner.jpg';
import logoMobile from './images/logo.png';
import logoText from './images/logo_text.jpeg';
import './App.scss';
import React from 'react';
import ReactDOM from 'react-dom';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="app-logo-desktop">
          <img src={logoDesktop} alt="logo" />
        </div>
        <div className="app-logo-mobile">
          <img src={logoMobile} alt="logo" />
          <img src={logoText} alt="logo" />
        </div>
        <div class="contentDiv">
            <img class="arrow" src="https://cdn3.iconfinder.com/data/icons/google-material-design-icons/48/ic_keyboard_arrow_down_48px-128.png" />
        </div>
      </header>
      <body>
        <div className="introduction">
        <FadeInSection>
          <h3>In a time where value for money has never been so important, Yeats Electrical passionately believes in providing you with an excellent, reliable, and efficient service. </h3>
          <h3>With extensive experience in the South-East, across a multitude of tasks and work environments, we are adapted and suited to any requirements that you may have. Whether itâ€™s a full rewiring or a brief consultation to plan future work, then Yeats Electrical are the team for the job. </h3>
        </FadeInSection>
        </div>      
        <div className="our_services"> 
          <FadeInSection>
            <h2 className="blue-text">Our Services</h2>
          <ul>
            <li><img className="list-logo" src={logoMobile} alt="logo" />Domestic Renovations</li>
            <li><img className="list-logo" src={logoMobile} alt="logo" />Rewiring</li>
            <li><img className="list-logo" src={logoMobile} alt="logo" />Electric Vehicle Charging Points</li>
            <li><img className="list-logo" src={logoMobile} alt="logo" />Smart Lighting</li>
            <li><img className="list-logo" src={logoMobile} alt="logo" />Electric and Storage Heating</li>
            <li><img className="list-logo" src={logoMobile} alt="logo" />Fire Alarm Installations</li>
            <li><img className="list-logo" src={logoMobile} alt="logo" />EICRs</li>
          </ul>
          </FadeInSection>

        </div>

        <div className="service-block">
          <div className="service-wrapper">
            <img className="service-icon" src={school} alt="description of image" />
            <div className="service-text">
              <h3>Education</h3>
              <p>With the welfare of pupils and staff as a priority, at London Executive all members of staff must go through initial trial period, and they are trained, and security vetted to make sure they meet our high standards. From managing the cleaning of before and after school clubs, to the more specialist needs of holiday cleaning programs, we have the experience, resources and understanding to ensure we can match a service to your needs.</p>
            </div>
          </div> 

          <div className="service-wrapper">
            <img className="service-icon" src={office} alt="description of image"/>
            <div className="service-text">
              <h3>Offices</h3>
              <p>Understanding the fundamentals of office cleaning, we at London Executive realise the importance to impress clients in every way when they visit your offices. During these uncertain times staff are trained to perform extra sanitising cleans throughout the day to ensure the safety and well-being of staff and visitors to your premises.                                        </p>
             </div>
          </div> 

          <div className="service-wrapper">
            <img className="service-icon" src={handshake} alt="description of image"/>
            <div className="service-text desktop-padding-top">
              <h3>End of tenancy</h3>
              <p>At London Executive our service team are highly trained to deal with all
types of end of tenancy cleans, following a strict checklist to ensure the new tenant enters
a pristine home.</p>
            </div>
          </div> 
        </div> 
      </body>
    </div>
  );
}

export default App;

function FadeInSection(props) {
  const [isVisible, setVisible] = React.useState(false);
  const domRef = React.useRef();
  React.useEffect(() => {
    const observer = new IntersectionObserver(entries => {
      entries.forEach(entry => setVisible(entry.isIntersecting));
    });
    observer.observe(domRef.current);
  }, []);
  return (
    <div
      className={`fade-in-section ${isVisible ? 'is-visible' : ''}`}
      ref={domRef}
    >
      {props.children}
    </div>
  );
}
